import { Link } from "react-router-dom";

function Header() {
  return (
    <div className="header">
      <div className="container">
        <div className="header-flex">
          <div>
            <h1>Bwap constructions</h1>
          </div>
          <div className="nav-header">
            <Link to="#">Home</Link>
            <Link to="#">Home</Link>
            <Link to="#">Home</Link>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Header;
